<strong>strokes-alphabetic-lessp</strong> is a compiled Lisp function in `<code>strokes.el</code>'.</br>
</br>
(strokes-alphabetic-lessp <u>STROKE1</u> <u>STROKE2</u>)</br>
</br>
Return t if <u>STROKE1</u>'s command name precedes <u>STROKE2</u>'s in lexicographic order.
